import React from 'react';
import s from './Navbar.module.css';

const Navbar = () => {
    return (
     <div className={s.nav}>
       <div className={s.item}>
         <a href="/profile">Profile</a>
       </div>
       <div className={s.item}>
         <a href="/dialogs">Messages</a>
       </div>
       <div className={s.item}>
         <a href="/news">News</a>
       </div>
       <div className={s.item}>
         <a href="/music">Music</a>
       </div>
       <div className={s.item}>
         <a href="/settings">Settings</a>
       </div>

     </div>
    );
}
export default Navbar;
